pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/finance/PaymentSplitter.sol";

contract NFT is ERC721Enumerable, Ownable, PaymentSplitter {
  using Strings for uint256;

  string public baseURI;
  string public baseExtension = ".json";
  uint256 public cost = 100 ether;
  uint256 public maxSupply = 10000;
  uint256 public MAX_MINT_AMOUNT = 20;
  uint256 public airdrop_claimed = 0;
  uint256 public reserved_claimed = 0;
  
  uint256 public TOTAL_AIRDROP_AMOUNT = 500;
  uint256 public TOTAL_REVERSED = 500;
  address payable public payments;


  bool public paused = false;
  bool public all_whitelist = false;

  mapping(address => bool) public whitelisted;
  mapping (address => bool) public airdroppedList;
  
  constructor(
    string memory _name,
    string memory _symbol,
    string memory _initBaseURI,
    address[] memory _payees,
    uint256[] memory _shares
  ) ERC721(_name, _symbol) PaymentSplitter(_payees, _shares) payable {
    setBaseURI(_initBaseURI);
  }

  // internal
  function _baseURI() internal view virtual override returns (string memory) {
    return baseURI;
  }

  // public
  function mint(address _to, uint256 _mintAmount) public payable {
    uint256 supply = totalSupply();
    require(!paused, 'paused');
    require(_mintAmount > 0, 'need to be positive');
    require(_mintAmount <= MAX_MINT_AMOUNT, 'all nfts minted');
    require(msg.value >= cost * _mintAmount, 'amount of value not correct');
    require(supply + _mintAmount <= maxSupply - TOTAL_AIRDROP_AMOUNT - TOTAL_REVERSED, 'exceed mintable amount');

    for (uint256 i = 1; i <= _mintAmount; i++) {
      _safeMint(_to, supply + i);
    }
  }
  
    // public
  function airdrop() public {
    uint256 supply = totalSupply();
    require(!paused, 'paused');
    require(!airdroppedList[msg.sender], 'already got the nft');
    require(airdrop_claimed < TOTAL_AIRDROP_AMOUNT, 'all nfts claimed');
    require(whitelisted[msg.sender] || all_whitelist, 'not in the whitelist');

     _safeMint(msg.sender, supply + 1);
     airdroppedList[msg.sender] = true;
     airdrop_claimed = airdrop_claimed + 1;
  }
  
      // public
  function mint_by_team(address _to, uint256 _mintAmount) public onlyOwner {
    uint256 supply = totalSupply();
    require(_mintAmount > 0);
    require(reserved_claimed + _mintAmount <= TOTAL_REVERSED);

    for (uint256 i = 1; i <= _mintAmount; i++) {
      _safeMint(_to, supply + i);
    }
     reserved_claimed = reserved_claimed + _mintAmount;
  }



  function walletOfOwner(address _owner)
    public
    view
    returns (uint256[] memory)
  {
    uint256 ownerTokenCount = balanceOf(_owner);
    uint256[] memory tokenIds = new uint256[](ownerTokenCount);
    for (uint256 i; i < ownerTokenCount; i++) {
      tokenIds[i] = tokenOfOwnerByIndex(_owner, i);
    }
    return tokenIds;
  }

  function tokenURI(uint256 tokenId)
    public
    view
    virtual
    override
    returns (string memory)
  {
    require(
      _exists(tokenId),
      "ERC721Metadata: URI query for nonexistent token"
    );

    string memory currentBaseURI = _baseURI();
    return bytes(currentBaseURI).length > 0
        ? string(abi.encodePacked(currentBaseURI, tokenId.toString(), baseExtension))
        : "";
  }

  //only owner
  function setCost(uint256 _newCost) public onlyOwner {
    cost = _newCost;
  }

  //only owner
  function setAllWhitelist(bool _state) public onlyOwner {
    all_whitelist = _state;
  }

  function setmaxMintAmount(uint256 _newmaxMintAmount) public onlyOwner {
    MAX_MINT_AMOUNT = _newmaxMintAmount;
  }

  function setBaseURI(string memory _newBaseURI) public onlyOwner {
    baseURI = _newBaseURI;
  }

  function setBaseExtension(string memory _newBaseExtension) public onlyOwner {
    baseExtension = _newBaseExtension;
  }

  function pause(bool _state) public onlyOwner {
    paused = _state;
  }
 
 function whitelistUser(address _user) public onlyOwner {
    whitelisted[_user] = true;
  }

 function whitelistUsers(address[] memory _user) public onlyOwner {
    for (uint256 i; i < _user.length; i++) {
      address user = _user[i];
      whitelisted[user] = true;
    }
  }

  function removeWhitelistUser(address _user) public onlyOwner {
    whitelisted[_user] = false;
  }

  function removeWhitelistUsers(address[] memory _user) public onlyOwner {
    for (uint256 i; i < _user.length; i++) {
      address user = _user[i];
      whitelisted[user] = false;
    }
  }
  
  function balance () public view returns (uint256)  {
   return address(this).balance;
  }
}
